One of my very best friends last week was like “what?! you have a new podcast?? Instagram didn’t tell me that!” & she like actually watches my stories and stuff - so maybe you don’t know either? Decided it needs to be shouted off the rooftops, or 🔥-ed up in studio. 

@theinnercallpodcast <— 
now you know! 
It’s a podcast meant to inspire you, educate you and direct you to an intuitive life, an inner call life - if you will! Sometimes it’s hard to live an intuitive life when you’re not in community, and the hope of this podcast is to make you feel like you can listen in on people who are living that kind of life so you know you’re not out there on your own, while encouraging you to keep walking to the beat of your own drum. Go give it a listen & let me know what you think. 💕
every Tuesday is a full episode day & every Thursday is a mini one- like todays 7 minute takeaway from the @carlamorrison episode which was an absolute inspiration all the way through, but these 7 min of inspiration are truly 🤯

